import React from 'react'
import logo from '../assets/Logo.png';
import '../styles/Navbar.css';
import {Link} from 'react-router-dom';
function Navbar() {
    const logoContainerStyles = {
        borderRadius: '50%',
        width: '120px', // Adjust the width as needed
        height: '120px', // Adjust the height as needed
        marginRight: '20px', // Add some right margin to separate it from the Links
        overflow: 'hidden', // Ensure the logo stays within the circular container
      };
    const logoStyles = {
        height: '280px',
        width: '280px',
        marginRight: '0px', // Add some right margin to separate it from the Links
        marginLeft: '-30px',
        marginTop: '-50px'
    };
    return (
        <div className = "navbar">
            <img src ={logo} style = {logoStyles}/>
            <div className = "Links">
                <Link to= "/" >HOME</Link>
                <Link to="/About">ABOUT US </Link>
                <Link to="/Blog">BLOG</Link>
                <Link to="/Contact">CONTACT</Link>
            </div>
        </div>

    );
}

export default Navbar;
